"    <div id=\"topicTitle\">",
"     Patient information: Skull and facial fractures (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/skull-and-facial-fractures-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H9538869\">",
"      <span class=\"h1\">",
"       What are skull and facial fractures?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A fracture is another word for a broken bone. When people have a skull or facial fracture, they have broken 1 or more bones of their skull (head) or face (",
"      <a class=\"graphic graphic_figure graphicRef62443 \" href=\"mobipreview.htm?30/49/31507\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Skull and facial fractures can happen when people are hit hard on their head or face. Common causes of skull and facial fractures are falls, car accidents, and sports injuries.",
"     </p>",
"     <p>",
"      There are different kinds of fractures, depending on how the bone breaks. Some fractures are more serious than others. If the bone is only cracked, the fracture is usually not as serious. But if part of the bone is pushed in toward the brain, the fracture is more serious.",
"     </p>",
"     <p>",
"      Skull and facial fractures sometimes lead to serious problems, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Brain damage",
"       </li>",
"       <li>",
"        Bleeding in or on top of the brain",
"       </li>",
"       <li>",
"        An infection of the tissues around the brain and spinal cord",
"       </li>",
"       <li>",
"        Seizures &ndash; Seizures are waves of abnormal electrical activity in the brain. They can make people pass out, or move or behave strangely.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9538884\">",
"      <span class=\"h1\">",
"       What are the symptoms of a skull or facial fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms can be mild or severe, depending on where the fracture is and how serious it is. Possible symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Pain, swelling, or bleeding &ndash; Sometimes, it takes a day for the swelling to start.",
"       </li>",
"       <li>",
"        A headache",
"       </li>",
"       <li>",
"        Feeling very tired, confused, or dizzy",
"       </li>",
"       <li>",
"        Bruising around the eyes, or behind the ear",
"       </li>",
"       <li>",
"        Bleeding from the nose or ear",
"       </li>",
"       <li>",
"        Clear fluid draining from the nose or ear &ndash; This is spinal fluid, the fluid that surrounds the brain and spinal cord.",
"       </li>",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Trouble smelling, hearing, or seeing",
"       </li>",
"       <li>",
"        Weakness or numbness of the face",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9538899\">",
"      <span class=\"h1\">",
"       Is there a test for a skull or facial fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor will ask about the symptoms and injury, and do an exam. To look for a fracture, he or she can do a CT scan of the head. This is an imaging test that creates pictures of the skull and brain.",
"     </p>",
"     <p>",
"      The doctor might also do skull X-rays or other imaging tests.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9538914\">",
"      <span class=\"h1\">",
"       How are skull and facial fractures treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on the type of fracture and where it is.",
"     </p>",
"     <p>",
"      Many people will not need any treatment. If the skull bone only cracks but doesn&rsquo;t move out of place, people usually don&rsquo;t need treatment. But their doctor will watch them to follow their symptoms.",
"     </p>",
"     <p>",
"      People whose symptoms go away after a short time can usually leave the hospital after a few hours. But the doctor will probably recommend that someone watch them at home for 24 hours to make sure their symptoms don&rsquo;t get worse. &nbsp;",
"     </p>",
"     <p>",
"      People who have a serious fracture, or symptoms that get worse or don&rsquo;t go away, will need to stay in the hospital for a longer time. Depending on their fracture, people might be treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Antibiotic medicines to prevent infections",
"       </li>",
"       <li>",
"        Anti-seizure medicines to prevent seizures",
"       </li>",
"       <li>",
"        Vaccines &ndash; Vaccines are treatments that can prevent certain serious infections.",
"       </li>",
"       <li>",
"        Surgery",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9538929\">",
"      <span class=\"h1\">",
"       When should I call the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After the person with the fracture leaves the hospital, call the doctor or nurse if he or she has:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Nausea",
"       </li>",
"       <li>",
"        A headache that won&rsquo;t go away",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      You should bring the person back to the hospital immediately if he or she:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Starts vomiting",
"       </li>",
"       <li>",
"        Has a severe headache",
"       </li>",
"       <li>",
"        Has a seizure",
"       </li>",
"       <li>",
"        Has trouble walking, talking, or seeing",
"       </li>",
"       <li>",
"        Has weakness or numbness in his or her body",
"       </li>",
"       <li>",
"        Isn&rsquo;t acting like him- or herself",
"       </li>",
"       <li>",
"        Has blood or fluid leaking from the nose or ear",
"       </li>",
"       <li>",
"        Passes out",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9538944\">",
"      <span class=\"h1\">",
"       What can people do to help prevent skull and facial fractures?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To help prevent skull and facial fractures, people can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wear a helmet when they ride a bike or motorcycle, or play certain sports.",
"       </li>",
"       <li>",
"        Wear a seat belt every time they drive or ride in a car.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H9538959\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?39/45/40658?source=see_link\">",
