" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Olanzapine: Pediatric drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_general\" href=\"mobipreview.htm?36/36/37449?source=see_link\">",
"    see \"Olanzapine: Drug information\"",
"   </a>",
"   and",
"   <a class=\"drug drug_patient\" href=\"mobipreview.htm?28/16/28934?source=see_link\">",
"    see \"Olanzapine: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"block black-box-warn drugH1Div\" id=\"F5709177\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     ALERT: U.S. Boxed Warning",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     The FDA-approved labeling includes a boxed warning. See Warnings/Precautions section for a concise summary of this information.  For verbatim wording of the boxed warning, consult the product labeling or",
"     <a href=\"file://www.fda.gov\" target=\"_blank\">",
"      www.fda.gov",
"     </a>",
"     .",
"    </p>",
"   </div>",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F203156\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      ZyPREXA&reg;;",
