"      ZyPREXA&reg; Zydis&reg;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list cbnlist drugH1Div drugBrandNames\" id=\"F203157\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: Canada",
