var title_f33_24_34189="Sotalol after MI";
var content_f33_24_34189=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71934&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71934&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Decreased survival with sotalol in the SWORD trial",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 426px; height: 308px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Results from the Survival With Oral d-Sotalol (SWORD) trial. The administration of d-sotalol to patients with an ejection fraction &le;40 percent after either recent myocardial infarction (MI) or after symptomatic heart failure with a remote (&gt;42 days) MI was associated with increased mortality compared to placebo (5 versus 3.1 percent). The excess number of deaths was presumed to be primarily due to arrhythmias.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Waldo AL, Camm AJ, DeRuyter H, et al. Lancet 1996; 348:7.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
